import { shopsPageMockData } from "./mockData";

// Iterate over the shopsList array in the shopsPage mock data
const rows = shopsPageMockData.shopsList.map((shop, index) => ({
  id: index + 1, // Assign an ID based on the index (starting from 1)
  shop: shop.options[0].label, // Extract the shop name from the first option label in the shop list
}));

// Export the dynamically generated rows
export { rows };
